description:
A 1970s-set comedy centered on three upstart professional men working at an insurance company.

In 1970s England, three friends spend their days joking, drinking, fighting and chasing girls. Freddie  wants to leave their working-class world but cool, charismatic Bruce and lovable loser Snork are happy with life the way it is.

When Freddie gets a new job as a door-to-door salesman and bumps into his old school sweetheart Julie, the gang are forced to make choices that will change their lives forever...

